import React, { Component } from "react";
import Navbar from "./navbar";
import Login from "./login";

class Home extends Component{
    state = {
        toggleLogin: false,
    }

    handleCallbackLogin = (childData) => {
        this.setState({toggleLogin: childData})
        console.log("Data from child: " + childData.valueOf())
    }

    render() {
        return (
            <React.Fragment>
                <Navbar loginCallback = {this.handleCallbackLogin} />
                {this.state.toggleLogin && <Login />}

                <button onClick={this.handleLogin} className="btn btn-primary m-5">
                    Login
                </button>
            </React.Fragment>
        );
    }
}
export default Home;
